import React, { Component } from 'react';
import {Consumerp} from '../context'
class Details extends Component {
    render() {
        return (
            <div>
                <Consumerp>
                    {value=>{
                    const {title,company,info,img,inCart}=value.detailProduct
              return(
                  <div>
                      <h3 className="title">{title}</h3>
                  </div>
              )
              }}
                </Consumerp>
            </div>
        );
    }
}

export default Details;
